import React from "react";

import UsersList from "../components/UserList/UsersList";

const Users = () => {
  const USERS = [
    {
      id: 'u1',
      name: 'Keaanu Rave',
      image: "../../shared/Images/badminton-logo.png",
      teams: 3,
    },
  ]; //all capital because dummy data

  return <UsersList items={USERS} />;
};

export default Users;
